import React from 'react';
import { Link } from "react-router-dom";

const LinksBar = () => {

    return(
        <nav>
        <Link to='/'>Головна</Link>
        <Link>Послуги</Link>
        <Link>Відгуки</Link>
        <Link>Про нас</Link>
        <Link>Контакти</Link>
        <Link>Блог</Link>
        </nav>
    )
}

export default LinksBar
